import React from 'react'
import { TaskHolder } from "./TaskHolder";
import { ListTitle } from './ListTitle';
import { ListDeleteButton } from './ListDeleteButton';
import { Draggable } from 'react-beautiful-dnd';


export const List = ({index, list, setList, listItem}) => {

  return (
    <Draggable draggableId={listItem.id}>
        {(provided) => (
        <div className="list" key={index} ref={provided.innerRef} {...provided.draggableProps} {...provided.dragHandleProps}>
            <div className="listheader">
            <ListDeleteButton list={list} setList={setList} listItem={listItem} />
                <ListTitle />
            </div>
            <TaskHolder />
        </div>
        )}
    </Draggable>

  )
}
